<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Cek Akses - Premium Verified</title>
  <link href="https://fonts.googleapis.com/css2?family=Poppins:wght@400;600&display=swap" rel="stylesheet">
  <style>
    * { margin: 0; padding: 0; box-sizing: border-box; }
    body {
      font-family: 'Poppins', sans-serif;
      min-height: 100vh;
      background: linear-gradient(135deg, #0f2027, #203a43, #2c5364);
      display: flex;
      align-items: center;
      justify-content: center;
      padding: 20px;
      color: #fff;
    }
    .container {
      background: rgba(255,255,255,0.05);
      backdrop-filter: blur(15px);
      border-radius: 20px;
      padding: 40px;
      width: 100%;
      max-width: 500px;
      box-shadow: 0 10px 30px rgba(0,0,0,0.4);
      text-align: center;
      animation: fadeIn 1s ease;
    }
    h2 {
      font-size: 26px;
      margin-bottom: 20px;
      font-weight: 700;
      background: linear-gradient(90deg, #00c6ff, #0072ff);
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
    }
    input {
      width: 100%;
      padding: 14px;
      margin-top: 20px;
      border-radius: 12px;
      border: none;
      background: rgba(255,255,255,0.1);
      color: white;
      font-size: 16px;
      outline: none;
    }
    input::placeholder {
      color: #ccc;
    }
    button {
      width: 100%;
      padding: 14px;
      margin-top: 20px;
      background: linear-gradient(90deg, #00c6ff, #0072ff);
      border: none;
      border-radius: 12px;
      font-size: 16px;
      font-weight: 600;
      color: white;
      cursor: pointer;
      transition: all 0.3s ease;
    }
    button:hover {
      background: linear-gradient(90deg, #0072ff, #00c6ff);
      transform: translateY(-2px);
      box-shadow: 0 4px 20px rgba(0,114,255,0.4);
    }
    .status {
      margin-top: 25px;
      padding: 16px;
      border-radius: 10px;
      font-size: 16px;
      font-weight: 500;
      display: none;
      text-align: left;
      display: flex;
      align-items: center;
      gap: 10px;
    }
    .success {
      background: rgba(76, 175, 80, 0.15);
      color: #4CAF50;
      border: 1px solid #4CAF50;
    }
    .fail {
      background: rgba(244, 67, 54, 0.15);
      color: #f44336;
      border: 1px solid #f44336;
    }
    .status img {
      width: 28px;
      height: 28px;
    }
    a.owner-link {
      color: #00c6ff;
      text-decoration: underline;
    }
    .info {
      margin-top: 15px;
      font-size: 15px;
      line-height: 1.6;
      color: #ccc;
      margin-left: 38px;
    }
    @keyframes fadeIn {
      from { opacity: 0; transform: translateY(20px); }
      to { opacity: 1; transform: translateY(0); }
    }
  </style>
</head>
<body>

<div class="container">
  <h2>Verify Violet!</h2>
  <input type="text" id="inputCek" placeholder="Masukkan Nama atau Nomor">
  <button onclick="cekAkses()">Cek Sekarang</button>

  <div id="status" class="status"></div>
</div>
